description:
The Playfools were born in the late 1970s in a cheese factory in Southern California. Sunshine, Angel Dust and Steely Dan turned their brainwaves into FM radio transmitters broadcasting Adult Rock non-stop.&#13;
&#13;
Their mission is to make girls dance and get the boys to cry. They sport a black belt in full-contact karaoke and dream of Mark Knopfler playing a DJ set at Panorama Bar. &#13;
&#13;
Catch them yacht rocking in a night club near you or send them a letter to love@playfools.net
